import React from 'react';
import { 
    Flex, Stack, Grid, Box
 } from "@chakra-ui/core";
import { Form } from "../../components/Form";


const Home = () => {
    return (
        <Flex
            backgroundColor="green"
            w="100vw"
            h="100vh"
            align="center"
            justify="center"
        >
            <div>
            <Grid templateColumns="repeat(2, 1fr)" gap={1}>
            <Box w="100%" h="10" bg="blue.900" />
            <Box w="100%" h="20" bg="blue.900" />
            </Grid>
            </div>
        </Flex>
    );
}

export default Home;
